import React from "react";
import { Container, Card, CardContent } from "@mui/material";

const birthdayList = ({people})=>{
    return(
        <Container>
            {people.map((person)=>{
                const {id, name, age, image} = person;
                return(
                    <Card key={id}>
                        <CardContent>
                            <img src={image} alt={name} />
                            <div>
                                <h4>{name}</h4>
                                <p>{age} years</p>
                            </div>
                        </CardContent>
                    </Card>
                )
            })}
        </Container>
    )
}

export default birthdayList;
